        "<style type=\"text/css\">\n" +
        "\t.st0{fill:none;stroke:#000000;stroke-width:0.01;stroke-linecap:round;stroke-linejoin:round;}\n" +
        "</style>\n" +
        "<polyline class=\"st0\" points=\"";
    for (var i = 0; i < circledata.length; i++)
    {
        outputString += circledata[i][0].toFixed(5);
        outputString += ", ";
        outputString += circledata[i][1].toFixed(5);
        outputString += "\t";
    }

    outputString += "\"/>\n" +
        "</svg>";

    download("circledata.svg", outputString);
